import React, { useEffect, useState } from 'react'
import { useParams } from 'react-router-dom'

export default function BlogShow() {
  const [blog, setBlog]= useState({})
  const { id } = useParams()

  useEffect(() => {
    const getBlog = async () => {
      const blogData = await getOneBlog(id)
      console.log(blogData);
      setBlog(blogData)
    }
    getBlog()
  },[])

  return (
    <div>
      {
        blog && <h3>{blog.id}</h3>
      }
    </div>
  )
}
